              completionRate={completionRate}
              loading={loadingMetrics}
              error={metricsError}
            />
          </Suspense>
          <Suspense fallback={<div className="graph__skeleton" />}>
            <VolumeChart metrics={metrics} loading={loadingMetrics} error={metricsError} />
          </Suspense>
        </div>
      </section>
    </main>
  );
}

export default LandingPage;

